// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

/// @title Voting-Based Fund Disbursement System
/// @notice Contributors fund a campaign; manager creates spending requests; contributors vote to approve/reject disbursements.
contract VotingDisbursement {
    address public manager;
    uint public target;               // target in wei
    uint public deadline;             // unix timestamp
    uint public minimumContribution;  // in wei

    uint public totalContributed;
    uint public contributorsCount;

    struct Request {
        string description;
        address payable recipient;
        uint amount;           // in wei
        bool completed;
        uint approvalCount;
        mapping(address => bool) approvals; // tracks if address voted on this request
    }

    Request[] public requests;
    mapping(address => uint) public contributions;
    mapping(address => bool) public refunded;

    // --- Events ---
    event ContributionReceived(address indexed contributor, uint amount);
    event RequestCreated(uint indexed requestId, string description, address indexed recipient, uint amount);
    event Voted(address indexed voter, uint indexed requestId);
    event RequestFinalized(uint indexed requestId);
    event RefundClaimed(address indexed claimant, uint amount);

    modifier onlyManager() {
        require(msg.sender == manager, "Only manager can call");
        _;
    }

    modifier beforeDeadline() {
        require(block.timestamp < deadline, "Deadline passed");
        _;
    }

    modifier afterDeadline() {
        require(block.timestamp >= deadline, "Deadline not reached");
        _;
    }

    constructor(uint _targetInEther, uint _durationInDays, uint _minimumContributionWei) {
        manager = msg.sender;
        target = _targetInEther * 1 ether;
        deadline = block.timestamp + (_durationInDays * 1 days);
        minimumContribution = _minimumContributionWei;
    }

    // Contribute to the campaign (payable)
    function contribute() external payable beforeDeadline {
        require(msg.value >= minimumContribution, "Contribution below minimum");

        if (contributions[msg.sender] == 0) {
            contributorsCount += 1; // new contributor
        }
        contributions[msg.sender] += msg.value;
        totalContributed += msg.value;

        emit ContributionReceived(msg.sender, msg.value);
    }

    // Manager creates a spending request
    function createRequest(string calldata _description, address payable _recipient, uint _amountWei) external onlyManager {
        require(_amountWei <= address(this).balance, "Requested amount exceeds contract balance");

        // push an empty struct and then set fields because Request contains a mapping
        requests.push();
        uint idx = requests.length - 1;
        Request storage r = requests[idx];
        r.description = _description;
        r.recipient = _recipient;
        r.amount = _amountWei;
        r.completed = false;
        r.approvalCount = 0;

        emit RequestCreated(idx, _description, _recipient, _amountWei);
    }

    // Approve a spending request (one vote per contributor per request)
    function approveRequest(uint requestIndex) external {
        require(requestIndex < requests.length, "Invalid request index");
        require(contributions[msg.sender] > 0, "Only contributors can vote");

        Request storage r = requests[requestIndex];
        require(!r.completed, "Request already completed");
        require(!r.approvals[msg.sender], "Already voted");

        r.approvals[msg.sender] = true;
        r.approvalCount += 1;

        emit Voted(msg.sender, requestIndex);
    }

    // Finalize request: manager executes payment if majority of contributors approved
    function finalizeRequest(uint requestIndex) external onlyManager {
        require(requestIndex < requests.length, "Invalid request index");
        Request storage r = requests[requestIndex];
        require(!r.completed, "Request already completed");
        require(address(this).balance >= r.amount, "Insufficient funds in contract");

        // democratic rule: requires more than 50% of contributors to approve
        require(r.approvalCount * 2 > contributorsCount, "Not enough approvals (requires majority)");

        // mark completed then transfer (checks-effects-interactions)
        r.completed = true;
        (bool sent, ) = r.recipient.call{value: r.amount}("");
        require(sent, "Transfer failed");

        emit RequestFinalized(requestIndex);
    }

    // Claim refund if target not met by deadline
    function claimRefund() external afterDeadline {
        require(totalContributed < target, "Target was met; no refunds");
        uint contributed = contributions[msg.sender];
        require(contributed > 0, "No contribution to refund");
        require(!refunded[msg.sender], "Already refunded");

        refunded[msg.sender] = true;
        contributions[msg.sender] = 0;

        (bool sent, ) = payable(msg.sender).call{value: contributed}("");
        require(sent, "Refund transfer failed");

        emit RefundClaimed(msg.sender, contributed);
    }

    // View number of requests
    function getRequestsCount() external view returns (uint) {
        return requests.length;
    }

    // Utility to check request basics (can't return mapping inside struct)
    function getRequestSummary(uint requestIndex) external view returns (
        string memory description,
        address recipient,
        uint amount,
        bool completed,
        uint approvalCount
    ) {
        require(requestIndex < requests.length, "Invalid request index");
        Request storage r = requests[requestIndex];
        return (r.description, r.recipient, r.amount, r.completed, r.approvalCount);
    }
}

